import styled from 'styled-components';

export const Container = styled.div`
  background-color: #2f3136;
  height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;

  main {
    background-color: #36393f;
    min-width: 340px;
    border-radius: 0px 4px 0px 12px rgba(0,0,0,0.1);
    padding: 12px;
  }
`;
